              <tr>
                {data.columns && data.columns.map((name: string, i: number) => (
                  <th key={i}>name</th>
                ))}
                <th>Country</th>
                <th>City</th>
                <th className="text-center">Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Dakota Rice</td>
                <td>Niger</td>
                <td>Oud-Turnhout</td>
                <td className="text-center">$36,738</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  )
}
